import { useAuth0 } from "@auth0/auth0-react";
import { useEffect } from "react";

const DeleteUser = () => {
    const {logout} = useAuth0();
    useEffect(() => {
        fetch('http://localhost:8080/api/v1/Users/111', { method: 'DELETE' })
            .then(() => logout());
    
    }, []);
    };

    export default DeleteUser;
